import React from 'react';

export default function GetinTouch() {
  const getintouch = [
    {
      name: 'Mr. Vikas Babu Jain',
      desc: 'M.D, Miss Valenine',
      img: VikasImage,
    },
    {
      name: 'Mr. Pawan Kumar Jain',
      desc: 'Director, Miss Valenine',
      img: PawanImage,
    },
    {
      name: 'Mr. Siddharth jain',
      desc: 'Director, Miss Valenine',
      img: SiddhartImage,
    },
  ];

  return (
    <div className="c-getintouch">
      <div className="c-getintouch__title"> Get in touch</div>
      <div className="c-getintouch__subtitle">
        want to get in touch? We'd love to hear from you. Here's how you can
        reach us...
      </div>
      <div className="c-getintouch__cards">
        {getintouch.map((d, i) => (
          <div key={i} className="c-getintouch__cards-card">
            <img
              alt={'director ' + d.name}
              className="c-getintouch__cards-card-img"
              src={d.img}
            />
            <div className="c-getintouch__cards-card-name">{d.name}</div>
            <div className="c-getintouch__cards-card-desc">{d.desc}</div>
          </div>
        ))}
      </div>
    </div>
  );
}
